import React, { Component } from 'react';
import Recipe from "./Recipe"
import './App.css';

const recipe = {
  name: String,
  description: String,
  link: String,
  recommend: Boolean
}

class App extends Component {
  constructor() {
    super();
    this.state = {
      recipes: []
    }
    this.somefunc = this.somefunc.bind(this)
  }
  componentDidMount(){
    var self = this;
    self.setState({
      recipes: recipe
    });
  }
  somefunc(){
  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <section id = "Recipes">
            {this.state.recipes.map((newRecipe)=>
              <Recipe
              somefunc = {this.somefunc} 
            />
            )}

          </section>
        </header>
      </div>
    );
  }
}
export default App;
